// ==UserScript==
// @name          Arthoria: Phasenmuster
// @namespace     Voltan
// @description   Phasenmuster Loesungsscript
// @include       http://arthoria.de/?p=imgriddle
// @include       http://arthoria.de/index.php?p=imgriddle
// @run-at        document-end
// @version       1.3

// ==/UserScript==

window.addEventListener ("load", start, false);

function getThisElement(tagName, property, value){
  var all = document.getElementsByTagName(tagName);
  var arr = [];
  for(var i = 0; i < all.length; i++){
    if(property == "alt"){
      if(all[i].alt == value){
        return all[i];
      }
    }
  }
}

function riddletype(){
  var all = document.getElementsByTagName('p');
  for(var i = 0; i < all.length; i++){
    if (all[i].align == "center"){
      if(all[i].textContent.match("Sortiere die Symbole aufsteigend nach ihrer") != null){
        return 'ascending';
      }else if (all[i].textContent.match("Sortiere die Symbole absteigend nach ihrer") != null){
        return 'descending';
      }
    }
  }
}

function start(){

  var symTable = getThisElement("img","alt","Symboltabelle");
  var symForm = document.getElementById('frmsol').parentElement;

  if(confirm("Phasenmusterloesung eintragen?") == true){
    var symbolData = [];
    for (var s = 1; s < 10; s++){
      symbolData[s] = [0,0];
    }
    initData();
    var counter = [];
    for (var c = 1; c < 10; c++){
      counter[c-1] = [c,0];
    }
    work();
  }

  function work(){
    count(slice());
    counter.sort(function(a, b){ return a[1]-b[1]; })
    var solution = writeArray(counter);
    var input = document.getElementById("frmsol");
    input.value = solution;
    if(confirm("Loesung absenden?")){
      symForm.submit();
    }
    //alert("Loesung eingetragen. Sie koennen nun auf  'Weiter' klicken.");
  }

  function slice() {
    var pieces = [];
    for(var y = 0; y < 6; y++) {
      for(var x = 0; x < 8; x++) {
        var canvas = document.createElement('canvas');
        canvas.width = 64;
        canvas.height = 64;
        var context = canvas.getContext('2d');
        context.drawImage(symTable, x * 64, y * 64, 64, 64, 0, 0, 64, 64);
        pieces.push(canvas.toDataURL());
      }
    }
    return pieces;
  }

  function count(pieces){
    for (var i = 0; i < pieces.length; i++){
      for (var j = 0; j < 9; j++){
        if(symbolData[j+1][0] == pieces[i] || symbolData[j+1][1] == pieces[i] || symbolData[j+1][2] == pieces[i]){
          counter[j][1]++;
        }
      }
    }
  }

  function writeArray(counter){
    var sol = []
    for(var i = 0; i < counter.length; i++){
      sol.push(counter[i][0])
    }
    if (riddletype() == 'ascending'){
      return sol;
    }else{
      return sol.reverse();
    }
  }

  function initData(){
    //dataset for Presto
    symbolData[1][0] = 'data:image/png;base64,';
    symbolData[2][0] = 'data:image/png;base64,';
    symbolData[3][0] = 'data:image/png;base64,';
    symbolData[4][0] = 'data:image/png;base64,';
    symbolData[5][0] = 'data:image/png;base64,';
    symbolData[6][0] = 'data:image/png;base64,';
    symbolData[7][0] = 'data:image/png;base64,';
    symbolData[8][0] = 'data:image/png;base64,';
    symbolData[9][0] = 'data:image/png;base64,';

    //dataset for Gecko
    symbolData[1][1] = 'data:image/png;base64,';
    symbolData[2][1] = 'data:image/png;base64,';
    symbolData[3][1] = 'data:image/png;base64,';
    symbolData[4][1] = 'data:image/png;base64,';
    symbolData[5][1] = 'data:image/png;base64,';
    symbolData[6][1] = 'data:image/png;base64,';
    symbolData[7][1] = 'data:image/png;base64,';
    symbolData[8][1] = 'data:image/png;base64,';
    symbolData[9][1] = 'data:image/png;base64,';

    // dataset for Chromium
    symbolData[1][2] = 'data:image/png;base64,';
    symbolData[2][2] = 'data:image/png;base64,';
    symbolData[3][2] = 'data:image/png;base64,';
    symbolData[4][2] = 'data:image/png;base64,';
    symbolData[5][2] = 'data:image/png;base64,';
    symbolData[6][2] = 'data:image/png;base64,';
    symbolData[7][2] = 'data:image/png;base64,';
    symbolData[8][2] = 'data:image/png;base64,';
    symbolData[9][2] = 'data:image/png;base64,';

  }

}
